import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';


const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
} = wp.components;

const name = "gb/simplewithdescription";

registerBlockType(name, {
  title: __("Simple With Description", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "newsletter",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    message: {
      type: "string",
      default: "",
    },
    subject: {
      type: "string",
      default: "",
    },
    to: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentt: { type: "string", default: `Sign up for our newsletter` },
    contentUA: {
      type: "string",
      default: `Anim aute id magna aliqua ad ad non deserunt sunt. Qui irure qui Lorem cupidatat commodo. Elit sunt amet fugiat veniam occaecat fugiat.`,
    },
    contentUB: { type: "string", default: `Email address` },
    contentUC: { type: "string", default: `Notify me` },
    contentUD: {
      type: "string",
      default: `We care about the protection of your data. Read our `,
    },
    contentUE: { type: "string", default: ` Privacy Policy. ` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;

    return (
      <div className="bg-white">
         <InspectorControls>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={attributes.to}
                    onChange={(to) => setAttributes({to})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={attributes.subject}
                    onChange={(subject) => setAttributes({subject})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={attributes.message}
                    onChange={(message) => setAttributes({message})}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>

        <div className="max-w-7xl mx-auto py-24 px-4 sm:px-6 lg:py-32 lg:px-8 lg:flex lg:items-center">
          
          <div className="lg:w-0 lg:flex-1">
            
            <h2 className="text-3xl font-extrabold text-gray-900 sm:text-4xl">
              <RichText
                value={attributes.contentt}
                default={"Sign up for our newsletter"}
                onChange={(newtext) => setAttributes({ contentt: newtext })}
              />
            </h2>
            <p className="mt-3 max-w-3xl text-lg text-gray-500">
              <RichText
                value={attributes.contentUA}
                default={
                  "Anim aute id magna aliqua ad ad non deserunt sunt. Qui irure qui Lorem cupidatat commodo. Elit sunt amet fugiat veniam occaecat fugiat."
                }
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </p>
          </div>
          <div className="mt-8 lg:mt-0 lg:ml-8">
            
            <form className="sm:flex">
              
              <label for="email-address" className="sr-only">
                <RichText
                  value={attributes.contentUB}
                  default={"Email address"}
                  onChange={(newtext) =>
                    setAttributes({ contentUB: newtext })
                  }
                />
              </label>
              <input
                id="email-address"
                name="email-address"
                type="email"
                autocomplete="email"
                required
                className="w-full px-5 py-3 border border-gray-300 shadow-sm placeholder-gray-400 focus:ring-1 focus:ring-indigo-500 focus:border-indigo-500 sm:max-w-xs rounded-md"
                placeholder="Enter your email"
              />
              <div className="mt-3 rounded-md shadow sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                
                <button
                  type="submit"
                  className="w-full flex items-center justify-center py-3 px-5 border border-transparent text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                >
                  <RichText
                    value={attributes.contentUC}
                    default={"Notify me"}
                    onChange={(newtext) =>
                      setAttributes({ contentUC: newtext })
                    }
                  />
                </button>
              </div>
            </form>
            <p className="mt-3 text-sm text-gray-500">
              <RichText
                value={attributes.contentUD}
                default={"We care about the protection of your data. Read our "}
                onChange={(newtext) => setAttributes({ contentUD: newtext })}
              />
              <a href="#" className="font-medium underline">
                <RichText
                  value={attributes.contentUE}
                  default={" Privacy Policy. "}
                  onChange={(newtext) =>
                    setAttributes({ contentUE: newtext })
                  }
                />
              </a>
            </p>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-24 px-4 sm:px-6 lg:py-32 lg:px-8 lg:flex lg:items-center">
          
          <div class="lg:w-0 lg:flex-1">
            
            <h2 class="text-3xl font-extrabold text-gray-900 sm:text-4xl">
             <RichText.Content value={attributes.contentt}/>
            </h2>
            <p class="mt-3 max-w-3xl text-lg text-gray-500">
             <RichText.Content value={attributes.contentUA}/>
            </p>
          </div>
          <div class="mt-8 lg:mt-0 lg:ml-8">
            
            <form class="sm:flex"
            action={attributes.action}
              method={attributes.method}
            >
              {arData.map((v) => {
                return <input type="hidden" name={v.name} value={v.val} />;
              })}
              
              <label for="email-address" class="sr-only">
               <RichText.Content value={attributes.contentUB}/>
              </label>
              <input
                id="email-address"
                name="email-address"
                type="email"
                autocomplete="email"
                required
                class="w-full px-5 py-3 border border-gray-300 shadow-sm placeholder-gray-400 focus:ring-1 focus:ring-indigo-500 focus:border-indigo-500 sm:max-w-xs rounded-md"
                placeholder="Enter your email"
              />
              <div class="mt-3 rounded-md shadow sm:mt-0 sm:ml-3 sm:flex-shrink-0">
                
                <button
                  type="submit"
                  onclick={`sendEmail('${name}'); return false;`}
                  class="w-full flex items-center justify-center py-3 px-5 border border-transparent text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500"
                >
                 <RichText.Content value={attributes.contentUC}/>
                </button>
              </div>
            </form>
            <p class="mt-3 text-sm text-gray-500">
             <RichText.Content value={attributes.contentUD}/>
              <a
                href={
                  attributes.contentUE.match('(.*?)href="(.*?)"(.*?)')
                    ? attributes.contentUE.match('(.*?)href="(.*?)"(.*?)')[2]
                    : attributes.contentUE
                }
                class="font-medium underline"
              >
                {attributes.contentUE.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
                  ? attributes.contentUE.match(
                      "(?<=<.+.>)(.*?)(?=<.*/.+.?>)"
                    )[0]
                  : attributes.contentUE}
              </a>
            </p>
          </div>
        </div>
      </div>
    );
  },
});
